import React, { Component } from 'react';
import Todos from './components/Todos';
import './App.css';

class App extends Component {
  state={
    todos:[
      {
        id: 1,
        title: 'Take out the trash',
        completed: false
      },
      {
        id: 2,
        title: 'Eat',
        completed: false
      },
      {
        id: 3,
        title: 'Meet with boss',
        completed: false
      }
    ]
  }
  render(){
    return (
      <div className="App">
        <Todos>this.state.todoes</Todos>
      </div>
    );
  }
}

export default App;
